  return (
    <div className="App">
      <BrowserRouter>
        <Nav /> {/* Render Nav component outside of Route */}
        <Routes>
          {/* Define your routes here */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
